package com.shanyuan.platform.ms.facade.index.domain;

public class IndexGoodsDomain {

	private String title;
	private String desc;
	private String touchUrlMore;
	private Object datas;
	
	
	public IndexGoodsDomain() {
		super();
		// TODO Auto-generated constructor stub
	}


	public String getTitle() {
		return title;
	}


	public void setTitle(String title) {
		this.title = title;
	}


	public String getDesc() {
		return desc;
	}


	public void setDesc(String desc) {
		this.desc = desc;
	}


	public String getTouchUrlMore() {
		return touchUrlMore;
	}


	public void setTouchUrlMore(String touchUrlMore) {
		this.touchUrlMore = touchUrlMore;
	}


	public Object getDatas() {
		return datas;
	}


	public void setDatas(Object datas) {
		this.datas = datas;
	}


	
	
}
